import React from 'react';

const Search = () => {
  return (
    <div class='row'>
      <form class='col s12'>
        <input id='email' type='search' placeholder='Search Logs' />
        <label htmlFor='search'>
          <i className='material-icons'>search</i>
        </label>
      </form>
    </div>
  );
};

export default Search;
